// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;


import "./openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "./openzeppelin/contracts/utils/EnumerableSet.sol";
import "./openzeppelin/contracts/math/SafeMath.sol";
import "./openzeppelin/contracts/access/Ownable.sol";
import "./TenetToken.sol";
import "./TenetMine.sol";
interface ISwapChef {
    // ,lptoken,
    // 1.2,lptoken
    // 2.,token,lptoken
    function swap(IERC20 lpToken,uint256 token0Amount,uint256 token1Amount) external returns (uint256);
}
// Tenet is the master of TEN. He can make TEN and he is a fair guy.
contract Tenet is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    // Info of each user.
    struct UserInfo {
        uint256 amount;     // lptoken
        uint256 rewardTokenDebt; // lptokentoken
        uint256 rewardTenDebt; // lptokenTEN
    }
    struct ProjectInfo {
        uint256 amount;     // lpten
        uint256 rewardTenDebt; // lptenTEN
    }
    // Info of each pool.
    struct PoolInfo {
        IERC20 lpToken;           // lptoken
        IERC20 tokenAddr;// token
        uint256 lastRewardBlock;  // token
        uint256 lpTokenTotalAmount;// lptoken
        uint256 accTokenPerShare; // lptokentoken
        uint256 accTenPerShare; // lptokenTEN
        address projectAddr;// pool
        uint256 tokenAmount;// token
        uint256 startBlock;// token
        uint256 endBlock;// token
        uint256 tokenPerBlock;// token
        uint256 tokenBonusEndBlock;// token
        uint256 tokenBonusMultipler;// 
        uint256 userCount;// 
    }

    struct TenPoolInfo {
        uint256 lastRewardBlock;  // TEN
        uint256 accTenPerShare; // lptenTEN
        uint256 allocPoint;// TEN  allocPoint/totalAllocPoint
        uint256 lpTokenTotalAmount;// lpten
    }

    // The TEN TOKEN!
    TenetToken public ten;
     // 
    TenetMine public tenMineCalc;
    // uniswaplpToken:Ten/ETH  
    IERC20 public lpTokenTen;            
    // Dev address.
    address public devaddr;
    // TEN
    uint256 public devaddrAmount;
    //
    uint256 public modifyAllocPointPeriod;
    //
    uint256 public lastModifyAllocPointBlock;
    //  
    uint256 public totalAllocPoint;
    // dev withdraw TEN tokens start block.
    uint256 public devWithdrawStartBlock;
    // add pool fee use TEN
    uint256 public addpoolfee;
    //,,:20%,2000
    uint256 public bonusAllocPointBlock;
    //
    uint256 public minProjectUserCount;

    uint256 public updateBlock;
    uint256 public constant MINLPTOKEN_AMOUNT = 10000000000;
    // Info of each pool.
    PoolInfo[] public poolInfo;// lptoken
    TenPoolInfo public tenProjectPool;// TENlpten
    TenPoolInfo public tenUserPool;// TENlpten
    // Info of each user that stakes LP tokens.
    mapping (uint256 => mapping (address => UserInfo)) public userInfo;// mapping( poolid => mapping ( => UserInfo) )
    mapping (uint256 => ProjectInfo) public userInfoProjectPool;// pool pid->ProjectInfo
    mapping (address => UserInfo) public userInfoUserPool;//  ->UserInfo

    ISwapChef public swaplptoken;

    event AddPool(address indexed user, uint256 indexed pid, uint256 tokenAmount,uint256 lpTenAmount);
    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event MineLPToken(address indexed user, uint256 indexed pid, uint256 amountToken,uint256 amountTen);    
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event DepositLPTen(address indexed user, uint256 indexed pid, uint256 amount);
    event WithdrawLPTen(address indexed user, uint256 indexed pid, uint256 amount);    
    event MineLPTen(address indexed user, uint256 amount);    
    event EmergencyWithdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event DevWithdraw(address indexed user, uint256 amount);
    event DepositToken(address indexed user, uint256 indexed pid, uint256 amount);

    constructor(
        TenetToken _ten,
        TenetMine _tenMineCalc,
        IERC20 _lpTen,        
        address _devaddr,
        uint256 _allocPointProject,
        uint256 _allocPointUser,
        uint256 _devWithdrawStartBlock,
        uint256 _modifyAllocPointPeriod,
        uint256 _bonusAllocPointBlock,
        uint256 _minProjectUserCount
    ) public {
        ten = _ten;
        tenMineCalc = _tenMineCalc;
        devaddr = _devaddr;
        lpTokenTen = _lpTen;
        tenProjectPool.allocPoint = _allocPointProject;
        tenUserPool.allocPoint = _allocPointUser;
        totalAllocPoint = _allocPointProject + _allocPointUser;
        devaddrAmount = 0;
        devWithdrawStartBlock = _devWithdrawStartBlock;
        addpoolfee = 0;
        updateBlock = 0;
        modifyAllocPointPeriod = _modifyAllocPointPeriod;
        lastModifyAllocPointBlock = tenMineCalc.startBlock();
        bonusAllocPointBlock = _bonusAllocPointBlock;
        minProjectUserCount = _minProjectUserCount;
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }
    function set_updateContract(uint256 _updateBlock) public onlyOwner {
        updateBlock = _updateBlock;
    }
    function set_addPoolFee(uint256 _addpoolfee) public onlyOwner {
        addpoolfee = _addpoolfee;
    }
    function set_swap(ISwapChef _swaplptoken) public onlyOwner {
        swaplptoken = _swaplptoken;
    }
    function set_devWithdrawStartBlock(uint256 _devWithdrawStartBlock) public onlyOwner {
        devWithdrawStartBlock = _devWithdrawStartBlock;
    }   
    function set_allocPoint(uint256 _allocPointProject,uint256 _allocPointUser) public onlyOwner {
        updateTenProjectPool();
        updateTenUserPool();
        tenProjectPool.allocPoint = _allocPointProject;
        tenUserPool.allocPoint = _allocPointUser;
        totalAllocPoint = _allocPointProject + _allocPointUser;        
    }
    // uniswapweb
    function add(IERC20 _lpToken,
            IERC20 _tokenAddr,
            uint256 _tokenAmount,
            uint256 _startBlock,
            uint256 _endBlockOffset,
            uint256 _tokenPerBlock,
            uint256 _tokenBonusEndBlockOffset,
            uint256 _tokenBonusMultipler,
            uint256 _lpTenAmount) public {
        if(_startBlock == 0){
            _startBlock = block.number;
        }
        require(block.number <= _startBlock, "add: startBlock invalid");
        require(_endBlockOffset >= _tokenBonusEndBlockOffset, "add: bonusEndBlockOffset invalid");
        require(tenMineCalc.getMultiplier(_startBlock,_startBlock + _endBlockOffset,_startBlock + _endBlockOffset,_startBlock + _tokenBonusEndBlockOffset,_tokenBonusMultipler).mul(_tokenPerBlock) <= _tokenAmount, "add: token amount invalid");
        if(updateBlock > 0){
            require(block.number <= updateBlock, "add: updateBlock invalid");
        }
        _tokenAddr.transferFrom(msg.sender,address(this), _tokenAmount);
        if(addpoolfee > 0){
            ten.transferFrom(msg.sender,address(this), addpoolfee);
            ten.burn(address(this),addpoolfee);
        }
        uint256 pid = poolInfo.length;
        poolInfo.push(PoolInfo({
            lpToken: _lpToken,
            tokenAddr: _tokenAddr,
            lastRewardBlock: block.number > _startBlock ? block.number : _startBlock,
            accTokenPerShare: 0,
            accTenPerShare: 0,
            lpTokenTotalAmount: 0,
            projectAddr: msg.sender,
            tokenAmount:_tokenAmount,
            startBlock: _startBlock,
            endBlock: _startBlock + _endBlockOffset,
            tokenPerBlock: _tokenPerBlock,
            tokenBonusEndBlock: _startBlock + _tokenBonusEndBlockOffset,
            tokenBonusMultipler: _tokenBonusMultipler,
            userCount: 0
        }));
        if(_lpTenAmount>0){
            depositTenByProject(pid,_lpTenAmount);
        }
        emit AddPool(msg.sender, pid, _tokenAmount,_lpTenAmount);
    }
    function updateAllocPoint() public {
        if(lastModifyAllocPointBlock.add(modifyAllocPointPeriod) <= block.number){
            uint256 totalLPTokenAmount = tenProjectPool.lpTokenTotalAmount.mul(bonusAllocPointBlock.add(1e4)).div(1e4).add(tenUserPool.lpTokenTotalAmount);
            if(totalLPTokenAmount > 0)
            {
                tenProjectPool.allocPoint = tenProjectPool.allocPoint.add(tenProjectPool.lpTokenTotalAmount.mul(1e4).mul(bonusAllocPointBlock.add(1e4)).div(1e4).div(totalLPTokenAmount)).div(2);
                tenUserPool.allocPoint = tenUserPool.allocPoint.add(tenUserPool.lpTokenTotalAmount.mul(1e4).div(totalLPTokenAmount)).div(2);
                totalAllocPoint = tenProjectPool.allocPoint + tenUserPool.allocPoint;
                lastModifyAllocPointBlock = block.number;
            }
        }     
    }
    // Update reward variables of the given pool to be up-to-date.
    function updateTenProjectPool() public {
        if (block.number <= tenProjectPool.lastRewardBlock) {
            return;
        }
        if (tenProjectPool.lpTokenTotalAmount == 0) {
            tenProjectPool.lastRewardBlock = block.number;
            return;
        }
        if(updateBlock > 0){
            if(block.number >= updateBlock){
                tenProjectPool.lastRewardBlock = block.number;
                return;                
            }
        }
        uint256 tenReward = tenMineCalc.calcMineTenReward(tenProjectPool.lastRewardBlock, block.number);
        tenReward = tenReward.mul(tenProjectPool.allocPoint).div(totalAllocPoint);
        devaddrAmount = devaddrAmount.add(tenReward.div(10));
        ten.mint(address(this), tenReward);
        tenProjectPool.accTenPerShare = tenProjectPool.accTenPerShare.add(tenReward.mul(1e12).div(tenProjectPool.lpTokenTotalAmount));
        tenProjectPool.lastRewardBlock = block.number;
        updateAllocPoint();
    }

    // lpten,ten
    function depositTenByProject(uint256 _pid,uint256 _amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        require(pool.projectAddr == msg.sender, "depositTenByProject: not good");
        ProjectInfo storage project = userInfoProjectPool[_pid];
        updateTenProjectPool();//lptenTEN
        if (project.amount > 0) {//TEN
            uint256 pending = project.amount.mul(tenProjectPool.accTenPerShare).div(1e12).sub(project.rewardTenDebt);
            if(pending > 0){
                if(pool.userCount == 0){
                    ten.burn(address(this),pending);
                }
                else{
                    if(pool.userCount<minProjectUserCount){//,
                        uint256 newPending = pending.mul(bonusAllocPointBlock.mul(pool.userCount).div(minProjectUserCount).add(1e4)).div(bonusAllocPointBlock.add(1e4));
                        ten.burn(address(this),pending.sub(newPending));
                        pending = newPending;
                    }                    
                    pool.accTenPerShare = pool.accTenPerShare.add(pending.mul(1e12).div(pool.lpTokenTotalAmount));//TEN,lptokenTEN
                }
            }
        }
        lpTokenTen.safeTransferFrom(msg.sender, address(this), _amount);
        tenProjectPool.lpTokenTotalAmount = tenProjectPool.lpTokenTotalAmount.add(_amount);
        project.amount = project.amount.add(_amount);
        project.rewardTenDebt = project.amount.mul(tenProjectPool.accTenPerShare).div(1e12);
        emit DepositLPTen(msg.sender, 1, _amount);
    }

    // lpten,ten
    function withdrawTenByProject(uint256 _pid,uint256 _amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        require(pool.projectAddr == msg.sender, "withdrawTenByProject: not good");
        ProjectInfo storage project = userInfoProjectPool[_pid];
        require(project.amount >= _amount, "withdrawTenByProject: not good");
        updateTenProjectPool();//lptenTEN
        uint256 pending = project.amount.mul(tenProjectPool.accTenPerShare).div(1e12).sub(project.rewardTenDebt);
        if(pending>0){
            if(pool.userCount == 0){
                ten.burn(address(this),pending);
            }
            else{
                if(pool.userCount<minProjectUserCount){//,
                    uint256 newPending = pending.mul(bonusAllocPointBlock.mul(pool.userCount).div(minProjectUserCount).add(1e4)).div(bonusAllocPointBlock.add(1e4));
                    ten.burn(address(this),pending.sub(newPending));
                    pending = newPending;
                }
                pool.accTenPerShare = pool.accTenPerShare.add(pending.mul(1e12).div(pool.lpTokenTotalAmount));//TEN,lptokenTEN
            }
        }
        project.amount = project.amount.sub(_amount);
        project.rewardTenDebt = project.amount.mul(tenProjectPool.accTenPerShare).div(1e12);
        lpTokenTen.safeTransfer(address(msg.sender), _amount);
        tenProjectPool.lpTokenTotalAmount = tenProjectPool.lpTokenTotalAmount.sub(_amount);
        emit WithdrawLPTen(msg.sender, 1, _amount);
    }

   // TEN,lptenTEN
    function updateTenUserPool() public {
        if (block.number <= tenUserPool.lastRewardBlock) {
            return;
        }
        if (tenUserPool.lpTokenTotalAmount == 0) {
            tenUserPool.lastRewardBlock = block.number;
            return;
        }
        if(updateBlock > 0){
            if(block.number >= updateBlock){
                tenProjectPool.lastRewardBlock = block.number;
                return;                
            }
        }        
        //uint256 multiplier = getMultiplier(tenUserPool.lastRewardBlock, block.number,uint256(-1),bonusEndBlock,bonus_multiplier);
        //uint256 tenReward = multiplier.mul(tenPerBlock).mul(tenUserPool.allocPoint).div(totalAllocPoint);
        uint256 tenReward = tenMineCalc.calcMineTenReward(tenUserPool.lastRewardBlock, block.number);
        tenReward = tenReward.mul(tenUserPool.allocPoint).div(totalAllocPoint);
        devaddrAmount = devaddrAmount.add(tenReward.div(10));
        ten.mint(address(this), tenReward);
        tenUserPool.accTenPerShare = tenUserPool.accTenPerShare.add(tenReward.mul(1e12).div(tenUserPool.lpTokenTotalAmount));
        tenUserPool.lastRewardBlock = block.number;
        updateAllocPoint();
   }

    // lptenTEN
    function depositTenByUser(uint256 _amount) public {
        UserInfo storage user = userInfoUserPool[msg.sender];
        updateTenUserPool();//lptenTEN
        if (user.amount > 0) {// lptenTEN
            uint256 pending = user.amount.mul(tenUserPool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
            safeTenTransfer(msg.sender, pending);
        }
        lpTokenTen.safeTransferFrom(address(msg.sender), address(this), _amount);
        tenUserPool.lpTokenTotalAmount = tenUserPool.lpTokenTotalAmount.add(_amount);
        user.amount = user.amount.add(_amount);
        user.rewardTenDebt = user.amount.mul(tenUserPool.accTenPerShare).div(1e12);
        emit DepositLPTen(msg.sender, 2, _amount);
    }

    // lptenTEN
    function withdrawTenByUser(uint256 _amount) public {
        UserInfo storage user = userInfoUserPool[msg.sender];
        require(user.amount >= _amount, "withdrawTenByUser: not good");
        updateTenUserPool();//lptenTEN
        uint256 pending = user.amount.mul(tenUserPool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
        safeTenTransfer(msg.sender, pending);
        user.amount = user.amount.sub(_amount);
        user.rewardTenDebt = user.amount.mul(tenUserPool.accTenPerShare).div(1e12);
        lpTokenTen.safeTransfer(address(msg.sender), _amount);
        tenUserPool.lpTokenTotalAmount = tenUserPool.lpTokenTotalAmount.sub(_amount);
        emit WithdrawLPTen(msg.sender, 2, _amount);
    }

    // lptenTEN
    function mineLPTen() public {
        updateTenUserPool();//lptenTEN
        UserInfo storage user = userInfoUserPool[msg.sender];
        uint256 pending = user.amount.mul(tenUserPool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
        safeTenTransfer(msg.sender, pending);
        user.rewardTenDebt = user.amount.mul(tenUserPool.accTenPerShare).div(1e12);
        emit MineLPTen(msg.sender,pending);
    }

    // Update reward variables of the given pool to be up-to-date.
    function updateLPTokenPool(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        if (block.number <= pool.lastRewardBlock) {
            return;
        }
        uint256 lpSupply = pool.lpTokenTotalAmount;
        if (lpSupply == 0) {
            pool.lastRewardBlock = block.number;
        }
        else{
            uint256 multiplier = tenMineCalc.getMultiplier(pool.lastRewardBlock, block.number,pool.endBlock,pool.tokenBonusEndBlock,pool.tokenBonusMultipler);
            uint256 tokenReward = multiplier.mul(pool.tokenPerBlock);
            pool.accTokenPerShare = pool.accTokenPerShare.add(tokenReward.mul(1e12).div(lpSupply));
            pool.lastRewardBlock = block.number;
        }
        updateTenProjectPool();//lptenTEN
        ProjectInfo storage project = userInfoProjectPool[_pid];
        if (project.amount > 0) {//TEN
            uint256 pending = project.amount.mul(tenProjectPool.accTenPerShare).div(1e12).sub(project.rewardTenDebt);
            if(pending>0){
                if(lpSupply == 0){
                    ten.burn(address(this),pending);
                }
                else{
                    if(pool.userCount < minProjectUserCount){//,
                        uint256 newPending = pending.mul(bonusAllocPointBlock.mul(pool.userCount).div(minProjectUserCount).add(1e4)).div(bonusAllocPointBlock.add(1e4));
                        ten.burn(address(this),pending.sub(newPending));
                        pending = newPending;
                    }
                    pool.accTenPerShare = pool.accTenPerShare.add(pending.mul(1e12).div(lpSupply));//ten,lptokenTEN
                }
                project.rewardTenDebt = project.amount.mul(tenProjectPool.accTenPerShare).div(1e12);
            }
        }        
    }

    // Deposit LP tokens to MasterChef for Token And TEN allocation.
    function depositLPToken(uint256 _pid, uint256 _amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        updateLPTokenPool(_pid);
        if (user.amount > 0) {
            uint256 pendingToken = user.amount.mul(pool.accTokenPerShare).div(1e12).sub(user.rewardTokenDebt);
            pool.tokenAddr.transfer(msg.sender, pendingToken);
            uint256 pendingTen = user.amount.mul(pool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
            safeTenTransfer(msg.sender, pendingTen);
        }else{
            pool.userCount = pool.userCount.add(1);
        }
        pool.lpToken.safeTransferFrom(address(msg.sender), address(this), _amount);
        pool.lpTokenTotalAmount = pool.lpTokenTotalAmount.add(_amount);
        user.amount = user.amount.add(_amount);
        user.rewardTokenDebt = user.amount.mul(pool.accTokenPerShare).div(1e12);
        user.rewardTenDebt = user.amount.mul(pool.accTenPerShare).div(1e12);
        emit Deposit(msg.sender, _pid, _amount);
    }

    // Withdraw LP tokens from MasterChef.
    function withdrawLPToken(uint256 _pid, uint256 _amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        require(user.amount >= _amount, "withdrawLPToken: not good");
        updateLPTokenPool(_pid);
        uint256 pendingToken = user.amount.mul(pool.accTokenPerShare).div(1e12).sub(user.rewardTokenDebt);
        pool.tokenAddr.transfer(msg.sender, pendingToken);
        uint256 pendingTen = user.amount.mul(pool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
        safeTenTransfer(msg.sender, pendingTen);
        user.amount = user.amount.sub(_amount);
        user.rewardTokenDebt = user.amount.mul(pool.accTokenPerShare).div(1e12);
        user.rewardTenDebt = user.amount.mul(pool.accTenPerShare).div(1e12);
        pool.lpToken.safeTransfer(address(msg.sender), _amount);
        pool.lpTokenTotalAmount = pool.lpTokenTotalAmount.sub(_amount);
        if(user.amount == 0){
            pool.userCount = pool.userCount.sub(1);
        }        
        emit Withdraw(msg.sender, _pid, _amount);
    }

    // 
    function getPoolUser(uint256 _pid, address _user) external view returns (uint256,uint256,uint256) {
        UserInfo storage user = userInfo[_pid][_user];
        return (user.amount,user.rewardTokenDebt,user.rewardTenDebt);
    }

    // lptokenTokenTEN
    function mineLPToken(uint256 _pid) public {
        updateLPTokenPool(_pid);
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 pendingToken = user.amount.mul(pool.accTokenPerShare).div(1e12).sub(user.rewardTokenDebt);
        pool.tokenAddr.transfer(msg.sender, pendingToken);
        uint256 pendingTen = user.amount.mul(pool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
        safeTenTransfer(msg.sender, pendingTen);
        user.rewardTokenDebt = user.amount.mul(pool.accTokenPerShare).div(1e12);
        user.rewardTenDebt = user.amount.mul(pool.accTenPerShare).div(1e12);
        emit MineLPToken(msg.sender, _pid, pendingToken,pendingTen);
    }

    // Withdraw without caring about rewards. EMERGENCY ONLY.
    function emergencyWithdraw(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        pool.lpToken.safeTransfer(address(msg.sender),user.amount);
        pool.lpTokenTotalAmount = pool.lpTokenTotalAmount.sub(user.amount);
        emit EmergencyWithdraw(msg.sender, _pid, user.amount);
        user.amount = 0;
        user.rewardTokenDebt = 0;
        user.rewardTenDebt = 0;
        pool.userCount = pool.userCount.sub(1);
    }

    // Update dev address by the previous dev.
    function dev(address _devaddr) public {
        require(msg.sender == devaddr, "dev: wut?");
        devaddr = _devaddr;
    }

    // TEN
    function devWithdraw(uint256 _amount) public {
        require(block.number >= devWithdrawStartBlock, "devWithdraw: start Block invalid");
        require(msg.sender == devaddr, "devWithdraw: devaddr invalid");
        require(devaddrAmount >= _amount, "devWithdraw: amount invalid");        
        ten.mint(devaddr,_amount);
        devaddrAmount = devaddrAmount.sub(_amount);
        emit DevWithdraw(msg.sender, _amount);
    }    

    // tokenlptoken,lptoken
    function depositToken(uint256 _pid, uint256 _token0Amount,uint256 _token1Amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        uint256 lpTokenAmount = swaplptoken.swap(pool.lpToken,_token0Amount,_token1Amount);
        UserInfo storage user = userInfo[_pid][msg.sender];
        updateLPTokenPool(_pid);
        if (user.amount > 0) {
            uint256 pendingToken = user.amount.mul(pool.accTokenPerShare).div(1e12).sub(user.rewardTokenDebt);
            pool.tokenAddr.transfer(msg.sender, pendingToken);
            uint256 pendingTen = user.amount.mul(pool.accTenPerShare).div(1e12).sub(user.rewardTenDebt);
            safeTenTransfer(msg.sender, pendingTen);
        }else{
            pool.userCount = pool.userCount.add(1);
        }
        //pool.lpToken.safeTransferFrom(address(msg.sender), address(this), _amount);
        pool.lpTokenTotalAmount = pool.lpTokenTotalAmount.add(lpTokenAmount);
        user.amount = user.amount.add(lpTokenAmount);
        user.rewardTokenDebt = user.amount.mul(pool.accTokenPerShare).div(1e12);
        user.rewardTenDebt = user.amount.mul(pool.accTenPerShare).div(1e12);        
        emit DepositToken(msg.sender, _pid, lpTokenAmount);        
    } 

    // Safe TEN transfer function, just in case if rounding error causes pool to not have enough TENs.
    function safeTenTransfer(address _to, uint256 _amount) internal {
        uint256 bal = ten.balanceOf(address(this));
        if (_amount > bal) {
            ten.transfer(_to, bal);
        } else {
            ten.transfer(_to, _amount);
        }
    }        
}
